import Painting from './Painting';

function PaintingsList(props) {

  return(
    <div>
      <h1>Paintings</h1>
      <button onClick={props.sortPaintings}>
        Sort Paintings By Vote
      </button>
      <hr />
      {
        props.paintings.map(painting => (
          <Painting
            key={painting.id}
            painting={painting}
          />
        ))
      }
    </div>
  );
}

export default PaintingsList;
